import React from 'react'

const Carbanner = ({img,name}) => {
  return (
    <div className='carbanner-container'>
        <div className='carbanner-section'>
            <img src={img} alt="CarImage" />
            <h1>{name}</h1>
        </div>
    </div>
  )
}

export default Carbanner
